            <span>{kiallitas.kezdodatum}</span>
            <span>{kiallitas.vegdatum}</span>
            <span>
              <button className="infoBtn" id={kiallitas.id}>
                <Link to={`/fajtaleirasok/${kiallitas.id}`}>
                  UitÄƒ-te la rezultate
                </Link>
              </button>
            </span>
          </div>
        ))}
      </div>
    );
  }
}

export default KapcsolatComponent;
